import logo from './logo.svg';
import './App.css';
import {Routes, Route, useNavigate} from 'react-router-dom';
import background from "./img/GCMateIcon.png"

function App() {
  const navigate = useNavigate(); 

  const goToPrompt = () => { navigate('/prompt'); }

  const goToInvalid = () => { navigate('/invalid'); }
  return (
    <div>
      <div>
        <button onClick={goToPrompt}>Prompt</button>
        <hr />
        <button onClick={goToInvalid}>Invalid</button>

        <Routes>
          <Route path="/Invalid" element={<Invalid />} />
          <Route path="/" element={<Prompt />} />
        </Routes>
      </div>
    </div>
  );
}

function Prompt() {
  return <h2> Prompt </h2>; 
}

function Invalid() {
  return <h2> Invalid </h2>;
}

export default App;
